import React, { Component } from 'react'; 
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom'; 
import './App.css';
import Login from './login'

class App extends Component {
  render() {
    return ( 
      <Router>
        <div className="App">
            <Switch> 
              <Route exact path='/' component={Login}></Route> 
            </Switch> 
          </div>
      </Router>
    );
  }
}

export default App;
